import "./Landing.scss";

import Hero from "../../components/Hero/Hero";
import Page from '../../components/Page/Page';
import Blob from "../../components/Blob/Blob";

export default function Landing() {

  return (
    <Page className="landing-page">
        <Hero className="landing-page">
            <Blob/>
        </Hero>
    </Page>
  );
}
